Undefined String for Mongoose.connect() on deploy, but works locally<p>I'm trying to deploy a node app to Render, but keep getting this error message: <strong>MongooseError: The <code>uri</code> parameter to <code>openUri()</code> must be a string, got &quot;undefined&quot;. Make sure the first parameter to <code>mongoose.connect()</code> or <code>mongoose.createConnection()</code> is a string.</strong></p>
<p>After searching on here for a while and trying different things, I'm still getting the same result and I don't really know why. My connection works locally, but when I try to deploy it fails.</p>
<pre><code>const express = require('express');
const mongoose = require('mongoose');
require('dotenv').config({path:__dirname+'/.env'});
const cors = require('cors')

const quizRoutes = require('./router/quiz');
const articleRoutes = require('./router/article');

const app = express(); 

//middleware
app.use(express.json());

app.use(cors());


app.use(function (req, res, next) {
    res.setHeader('Access-Control-Allow-Origin', '*');
    res.setHeader('Access-Control-Allow-Methods', 'GET, POST, PUT, DELETE');
    res.setHeader('Access-Control-Allow-Headers', 'Content-Type');
    res.setHeader('Access-Control-Allow-Credentials', true);
    next();
    });


app.use('/quiz', quizRoutes);
app.use('/articles', articleRoutes);

mongoose.connect(process.env.MONGO_URI)
    .then(() =&gt; {
        app.listen(process.env.PORT, () =&gt; {
            console.log(process.env)
            console.log('Port', process.env.PORT);
        })
    })
    .catch((error) =&gt; {
        console.log(error);
    })
</code></pre>
<pre><code>
PORT=4000
MONGO_URI=&quot;mongodb+srv://personalinfo.lahdouv.mongodb.net/?retryWrites=true&amp;w=majority&quot;
</code></pre>
<p>Changed Mongo_URI for obvious reasons, but that is the code I'm working with.</p>
<p>I tried changing the .env config, putting the URI in quotes, and trying to make sure that the .env file was being linked correctly. Locally, I used console.log to make sure, and it still works. Not sure where to go from here.</p>
<p>Any help is greatly appreciated and thank you very much for your time.</p>

