lookup with pipeline without specifying localfield and foreignfield<pre class="lang-js prettyprint-override"><code>db.Products.aggregate([
  {
    $lookup: {
      from: &quot;Products_History&quot;,
      localField: &quot;_fid&quot;,
      foreignField: &quot;_fid&quot;,
      as: &quot;joins&quot;,
      pipeline: [
        {
          &quot;$sort&quot;: {
            &quot;date&quot;: -1
          }
        }
      ]
    }
  },
  {
    &quot;$project&quot;: {
      &quot;_fid&quot;: 1,
      &quot;field1&quot;: 1,
      &quot;field2&quot;: 1,
      &quot;field3&quot;: 1,
      &quot;last_version&quot;: {
        $first: &quot;$joins.version&quot;
      }
    }
  },
  {
    $match: {
      &quot;last_version&quot;: {
        $exists: true
      }
    }
  }
])
</code></pre>
<p>This works well when MongoDB is version 5 or higher.</p>
<p>However, on my current version I am getting: &quot;$lookup with 'pipeline' may not specify 'localField' or 'foreignField'&quot;</p>
<p>Is there a way to fix the query while still joining them. I don't know of a different way to do this.</p>
<p><a href="https://mongoplayground.net/p/SYsmjYjOdNJ" rel="nofollow noreferrer">https://mongoplayground.net/p/SYsmjYjOdNJ</a></p>

