Aggregate by year, then by month, and day<p>I have a collection with dates in this format:</p>
<pre class="lang-js prettyprint-override"><code>{year: number, month: number, day: number}
</code></pre>
<p>I need to separate it into nested groups:</p>
<p><strong>Year ⇒ Month ⇒ Day</strong></p>
<p>The idea is to create a logic similar to a Timeline, but free to customize the view.</p>
<p>I tried to use MongoDB Aggregate:</p>
<pre class="lang-js prettyprint-override"><code>{ 
    _id : { 
    year : &quot;$dShow.year&quot;, 
    //month : &quot;$dShow.month&quot;,
    //day : &quot;$dShow.day&quot;
  },
  list: {
    $push: {
      _id: &quot;$_id&quot;,
      forever: &quot;$forever&quot;,
      text: &quot;$text&quot;,
      status: &quot;$status&quot;,
      recurrence: &quot;$recurrence&quot;,
      title: &quot;$title&quot;,
      dExpiration: &quot;$dExpiration&quot;,
      ownerId: &quot;$ownerId&quot;,
      dShow: &quot;$dShow&quot;
    }
  }
}
</code></pre>
<p>But I don't know how to make the next step.</p>
<p>The desired output is something like this:</p>
<pre class="lang-js prettyprint-override"><code>[
    &quot;years:&quot; {
        &quot;year&quot;: 2022,
        &quot;list&quot;: [
            {
                &quot;month&quot;: &quot;jan&quot;,
                &quot;list&quot;: [
                    {
                        &quot;day&quot;: 13,
                        &quot;list&quot;: [
                            {&quot;dShow&quot;: {&quot;year&quot;: 2022, &quot;month&quot;: 1, &quot;day&quot;: 13}, &quot;title&quot;: &quot;Title 1&quot;}
                        ]
                    }
                ]
            },
            {
                &quot;month&quot;: &quot;feb&quot;,
                &quot;list&quot;: [
                    {
                        &quot;day&quot;: 24,
                        &quot;list&quot;: [
                            {&quot;dShow&quot;: {&quot;year&quot;: 2022, &quot;month&quot;: 2, &quot;day&quot;: 24}, &quot;title&quot;: &quot;Another Title&quot;}
                        ]
                    }
                ]
            }
        ]
    }
]
</code></pre>
<p>PS.: I also consider a pipe in Angular, if there is a better idea.</p>

